const EighteenAge = (props) => {
    let {username, age, changeAge} = props
    return (
        <div>
        <h1> {username} age is {age}</h1>
        <button onClick={() => {
            changeAge(age+1)
        }}>Click me</button>
        </div>
    )
}

export default EighteenAge;
